import React from "react";

export default function Dashboard() {
  //handle logout
  const authApi = React.useContext(AuthApi);
  const handleLogout = async () => {
    const res = await signout();
    authApi.setAuth(res.data.auth);
  };

  return (
    <div>
      <p>Welcome!</p>
    </div>
  );
}
